import React from 'react'
import { Component } from 'ag-grid-community';
class Footer extends React.Component{
    render(){
        return(
            <React.Fragment>
               <div className="footer">
                   <div className="container">
                       <div className="row">
                           <div className="col-md-4">

                           </div>

                       </div>

                   </div>

               </div>
            </React.Fragment>
        )
    }
}
export default Footer;
